import React from 'react';
import ReactDOM from 'react-dom';
import './index.scss';
import App from './containers/App'
import { BrowserRouter } from 'react-router-dom'
import reportWebVitals from './reportWebVitals';

ReactDOM.hydrate(
  <BrowserRouter>
      <App />
  </BrowserRouter>,
  document.getElementById('root')
);

reportWebVitals();
